import React from 'react';
import './Account.css';

const Account = ({ user }) => {
  if (!user) {
    return (
      <div className="account-container">
        <div className="account-card">
          <div className="account-message">You are not logged in.</div>
        </div>
      </div>
    );
  }

  return (
    <div className="account-container">
      <div className="account-card">
        <h2 className="account-title">Account Details</h2>
        <div className="account-details">
          <div><b>Name:</b> {user.name}</div>
          <div><b>Email:</b> {user.email}</div>
          <div><b>Phone:</b> {user.phone}</div>
          {user.city && <div><b>City:</b> {user.city}</div>}
          {user.role && <div><b>Role:</b> {user.role}</div>}
          {user.createdAt && <div><b>Joined:</b> {new Date(user.createdAt).toLocaleDateString()}</div>}
        </div>
      </div>
    </div>
  );
};

export default Account;
